- proto: PaperOffice
  entities:
  - uid: 42
    components:
    - name: coregov letter
      type: MetaData
    - pos: 2.4532437,-4.334424
      parent: 2
      type: Transform
    - content: >-
        Welcome aboard the Kestrel! If you are reading this, your captain has taken out a loan for it. What does this mean? It means that you have to pay fees, rent specifically! Every time you dock at a base you have to pay fees such as the docking fee, the rent fee, general maintenance fee, and even worse... paychecks.


        Your crew deserve money, let them know that! Why are they working for you if not for the money? You have the right to pay your crew at stations, if not, then they may even go on strike.


        One last thing, I assume you have read a Spacer's Guidebook. If not, give it a read! It should have some useful stuff.


        Anyway, good luck captain! Sail the stars well.

        Sincerely, CoreGov Shipyard Officer,

        Dale Kurtman
      type: Paper
